import './App.css';
import { BrowserRouter as Routers, Route } from "react-router-dom";
import Home from "./Home.js";
import Customer from "./customerWindowGUI.js"

function App() {
  return (
      <Routers>
        <Route path="/" element={<Home />} />
        <Route path="/customer" element={<Customer />} />
      </Routers>
  );
}

export default App;
